INSERT INTO `config_info` VALUES (27, 'cloud-default.yml', 'DEFAULT_GROUP', 'project: \n  environment: ${environment:localhost}\n\nserver:\n  port: ${application-port}\n\nspring: \n  mvc.pathmatch.matching-strategy: ant_path_matcher\n  jackson: \n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n    default-property-inclusion: NON_NULL\n\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 30000\n        readTimeout: 30000\n  compression:\n    request:\n      # 开启请求数据的压缩功能\n      enabled: true\n      # 最小压缩值标准，当数据大于 1024 才会进行压缩\n      min-request-size: 1024\n      # 压缩类型\n      mime-types: text/xml,application/xml,application/json\n    response:\n      enabled: true\n\nlogging: \n  test: ON\n  file.name: log/log.log\n  config: http://${NACOS_CONFIG_SERVER:localhost:8848}/nacos/v1/cs/configs?group=DEFAULT_GROUP&dataId=boot-log.xml\n  level: \n    root: ERROR\n    com.maozi: INFO\n    org.apache.dubbo.registry.client: OFF\n    com.xxl.job.core.handler.impl.MethodJobHandler: INFO\n    org.springframework.cloud.stream.binding.StreamListenerMessageHandler: INFO', '60827132cb0afb9e24bc182d9c8c8d80', '2023-02-20 01:04:02', '2024-01-15 21:08:57', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (28, 'cloud-dubbo.yml', 'DEFAULT_GROUP', 'dubbo:\n  # registry.register-mode: instance/interface/all\n  application: \n    name: dubbo-${spring.application.name}\n    register-mode: instance\n    version: ${project.version:main}\n  scan:\n    base-packages: com.maozi.${application-project-abbreviation}.*.api.impl.rpc.*\n  protocol:\n    # name: tri\n    name: dubbo\n    port: ${application-dubbo-port}\n  provider:\n    filter: applicationLinkContextSetFilter\n  consumer:\n    check: false\n    timeout: 30000\n    retries: 0\n    filter: applicationLinkContextTransmitFilter\n  registry:\n    address: nacos://maozi-cloud-nacos:8848', 'b273b7e46946e4b39f36f4a20df99244', '2023-02-20 01:04:02', '2024-01-07 18:28:16', 'nacos', '172.30.0.1', '', '', '', '', '', 'yaml', '');
