INSERT INTO `config_info` VALUES (112, 'maozi-cloud-message.yml', 'DEFAULT_GROUP', 'application-port: 5000\n\napplication-project-name: message\n\napplication-datasource-jdbc-url: localhost:3306/maozi-test-db\napplication-datasource-jdbc-username: root\napplication-datasource-jdbc-password: password\n\napplication-rpc-service-name: \n\napplication-project-whitelist: /ws/message,/ws/sockjs/message,/**\n\n# RocketMQConsumerProperties\nspring.cloud.stream.bindings: \n\n  WS-USER-MESSAGE-OUTPUT: {destination: WS-USER-MESSAGE-TOPIC,content-type: application/json}\n  WS-USER-MESSAGE-INPUT: {destination: WS-USER-MESSAGE-TOPIC,content-type: application/json,group: WS-USER-MESSAGE-TOPIC-GROUP,consumer: {broadcasting: true}}\n\n  WS-USER-MESSAGE-PERMISSION-OUTPUT: {destination: WS-USER-MESSAGE-PERMISSION-TOPIC,content-type: application/json}\n  WS-USER-MESSAGE-PERMISSION-INPUT: {destination: WS-USER-MESSAGE-PERMISSION-TOPIC,content-type: application/json,group: WS-USER-MESSAGE-PERMISSION-TOPIC-GROUP,consumer: {broadcasting: true}}', '6a25555a4398e0a6565a3636feabb92f', '2023-02-20 01:04:02', '2023-02-20 01:04:02', NULL, '172.21.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
