INSERT INTO `his_config_info` VALUES (102, 1561, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', '', 'application-port: 10000\n\napplication-project-name: gateway\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      # - name: Hystrix\n      #   args:\n      #     name: default\n      #     fallbackUri: forward:/gateway/fallback\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-SSO\n          uri: lb://maozi-cloud-sso\n          predicates:\n          - Path=/sso/**\n\n        - id: MAOZI-CLOUD-FORM\n          uri: lb://maozi-cloud-form\n          predicates:\n          - Path=/form/**\n\n        - id: MAOZI-CLOUD-PAY\n          uri: lb://maozi-cloud-pay\n          predicates:\n          - Path=/pay/**\n\n\n        - id: MAOZI-CLOUD-ORDER\n          uri: lb://maozi-cloud-order\n          predicates:\n          - Path=/order/**\n\n        - id: MAOZI-CLOUD-MESSAGE\n          uri: lb://maozi-cloud-message\n          predicates:\n          - Path=/message/**\n          filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n\n# hystrix:\n#   enabled: true\n#   shareSecurityContext: true\n#   command:\n#     default:\n#       execution:\n#         isolation:\n#           strategy: SEMAPHORE\n#           thread:\n#             timeoutInMilliseconds: 3000\n\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST\n\n\n\n\nknife4j:\n  gateway:\n    enable: true\n    routes:\n      - name: 系统服务\n        url: /user/v2/api-docs?group=default\n        service-name: maozi-cloud-user\n      - name: 授权服务\n        url: /sso/v2/api-docs?group=default\n        service-name: maozi-cloud-sso', 'dff11158d22038a37bccf49262761f72', '2024-01-02 03:19:24', '2024-01-02 11:19:24', 'nacos', '172.30.0.1', 'U', '');
