          uri: lb://maozi-cloud-message\n          predicates:\n          - Path=/message/**\n          filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n\n# hystrix:\n#   enabled: true\n#   shareSecurityContext: true\n#   command:\n#     default:\n#       execution:\n#         isolation:\n#           strategy: SEMAPHORE\n#           thread:\n#             timeoutInMilliseconds: 3000\n\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST\n\n\n\n\nknife4j:\n  gateway:\n    enable: true\n    routes:\n      - name: 系统服务\n        url: /user/v2/api-docs?group=default\n        service-name: maozi-cloud-user\n      - name: 授权服务\n        url: /sso/v2/api-docs?group=default\n        service-name: maozi-cloud-sso', '2eed540a8f6d8eca1721ed8379730d36', '2024-01-02 07:23:53', '2024-01-02 15:23:54', 'nacos', '172.30.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (1483, 1570, 'maozi-cloud-monitor.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 监控服务\n  details: 监控 JVM、运行状态、配置、连接中间件状态 等功能\n\napplication-port: 8000\n\nspring:\n  security:\n    user:\n      name: admin\n      password: admin\n      \n  boot:\n    admin:\n      discovery: \n        services: maozi-cloud-*\n      ui:\n        external-views:\n        \n          - label: \"注册中心\"\n            url: \"http://maozi-cloud-nacos:8848/nacos/#/configurationManagement?dataId=&group=&appName=&namespace=&pageSize=&pageNo=\"\n            iframe: true\n            order: 2002\n\n          - label: \"接口文档\"\n            url: \"https://localhost:10000/doc.html\"\n            iframe: true\n            order: 2003\n\n          - label: \"容器管理\"\n            url: \"http://localhost:9000\"\n            iframe: true\n            order: 2004\n\n          - label: \"Arthas管理\"\n            url: \"http://localhost:9080\"\n            iframe: true\n            order: 2005', '818c7848054218c6ff732b256dff8498', '2024-01-02 07:24:38', '2024-01-02 15:24:38', 'nacos', '172.30.0.1', 'U', '');
