INSERT INTO `his_config_info` VALUES (0, 1575, 'boot-monitor.yml', 'DEFAULT_GROUP', '', 'spring:  \r\n  security:\r\n    user:\r\n      name: admin\r\n      password: admin\r\n  boot: \r\n    admin: \r\n      discovery: \r\n        services: maozi-cloud-*\r\n      client:\r\n        # url: http://localhost:8000\r\n        username: admin\r\n        password: admin\r\n        # auto-deregistration: true\r\n        # instance: \r\n        #   prefer-ip: true\r\n        #   metadata: \r\n        #     tags: \r\n        #       environment: 本地\r\n\r\nendpoints:\r\n  dubbo:\r\n    enabled: true\r\n\r\nmanagement:\r\n  info.env.enabled: true\r\n  health:\r\n    dubbo:\r\n      status:\r\n        defaults: memory\r\n        extras: load,threadpool\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  endpoint:\r\n    dubbo:\r\n      enabled: true\r\n    dubbo-shutdown:\r\n      enabled: true\r\n    dubbo-configs:\r\n      enabled: true\r\n    dubbo-services:\r\n      enabled: true\r\n    dubbo-references:\r\n      enabled: true\r\n    dubbo-properties:\r\n      enabled: true\r\n    health:\r\n      show-details: ALWAYS\r\n      probes.enabled: true', '6d9bdb9efc506c1238d1f1541f54c004', '2024-01-02 07:28:35', '2024-01-02 15:28:35', NULL, '172.30.0.1', 'I', '');
