INSERT INTO `his_config_info` VALUES (1480, 1586, 'maozi-cloud-system.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 系统服务\n  details: 管理 用户、角色、权限、系统配置 等功能\n\napplication-port: ${application-dev-port:2000}\napplication-dubbo-port: ${application-dev-dubbo-port:20881}\n\n# application-datasource-jdbc-url: localhost:3306/maozi-cloud-test-db\n# application-datasource-jdbc-username: root\n# application-datasource-jdbc-password: password\napplication-datasource-db-name: maozi-cloud-user-localhost-db\n\napplication-project-whitelist: /user/platform/v1/getToken,/config/global/system/get\n\napplication-project-system: \n  projectName: 小猫子\n  corporationName: 小猫子\n  icon: http://dummyimage.com/100x100\n  environment: ${project.environment}\n  description: 小猫子个人脚手架\n  copyright: 本网站所有权归《${application-project-system.corporationName}》所有，请勿抄袭和抄袭', '5f3878505b61c9c1391fc57eeb33d44c', '2024-01-02 07:58:18', '2024-01-02 15:58:18', 'nacos', '172.30.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (102, 1587, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 网关服务\n  details: 处理 流量分发、黑白名单、流控 等功能\n\napplication-port: ${application-dev-port:10000}\n\napplication-project-name: gateway\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      # - name: Hystrix\n      #   args:\n      #     name: default\n      #     fallbackUri: forward:/gateway/fallback\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-SSO\n          uri: lb://maozi-cloud-sso\n          predicates:\n          - Path=/sso/**\n\n        - id: MAOZI-CLOUD-FORM\n          uri: lb://maozi-cloud-form\n          predicates:\n          - Path=/form/**\n\n        - id: MAOZI-CLOUD-PAY\n          uri: lb://maozi-cloud-pay\n          predicates:\n          - Path=/pay/**\n\n\n        - id: MAOZI-CLOUD-ORDER\n          uri: lb://maozi-cloud-order\n          predicates:\n          - Path=/order/**\n\n        - id: MAOZI-CLOUD-MESSAGE\n          uri: lb://maozi-cloud-message\n          predicates:\n          - Path=/message/**\n          filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n\n# hystrix:\n#   enabled: true\n#   shareSecurityContext: true\n#   command:\n#     default:\n#       execution:\n#         isolation:\n#           strategy: SEMAPHORE\n#           thread:\n#             timeoutInMilliseconds: 3000\n\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST\n\n\n\n\nknife4j:\n  gateway:\n    enable: true\n    routes:\n      - name: 系统服务\n        url: /user/v2/api-docs?group=default\n        service-name: maozi-cloud-user\n      - name: 授权服务\n        url: /sso/v2/api-docs?group=default\n        service-name: maozi-cloud-sso', '7eb32ac505709713dbf8898dcfc653ef', '2024-01-02 07:59:17', '2024-01-02 15:59:17', 'nacos', '172.30.0.1', 'U', '');
INSERT INTO `his_config_info` VALUES (442, 1588, 'maozi-cloud-gateway-router.json', 'DEFAULT_GROUP', '', '[\n\n    {\n        \"id\": \"MAOZI-CLOUD-SYSTEM\",\n        \"order\": 2,\n        \"predicates\": [{\n            \"args\": {\n                \"pattern\": \"/system/**\"\n            },\n            \"name\": \"Path\"\n        }],\n        \"uri\": \"lb://maozi-cloud-system\"\n    },\n\n\n\n    {\n        \"id\": \"MAOZI-CLOUD-SSO\",\n        \"order\": 2,\n        \"predicates\": [{\n            \"args\": {\n                \"pattern\": \"/sso/**\"\n            },\n            \"name\": \"Path\"\n        }],\n        \"uri\": \"lb://maozi-cloud-sso\"\n    }\n\n]', 'e3b634eb081e01155a651c45f8c473ed', '2024-01-02 07:59:49', '2024-01-02 15:59:50', 'nacos', '172.30.0.1', 'U', '');
