INSERT INTO `his_config_info` VALUES (27, 1590, 'cloud-default.yml', 'DEFAULT_GROUP', '', 'project: \n  environment: ${environment:localhost}\n\nserver:\n  port: ${application-port}\n\nspring: \n  mvc.pathmatch.matching-strategy: ant_path_matcher\n  jackson: \n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n    default-property-inclusion: NON_NULL\n\nfeign:\n  okhttp: \n    enabled: true\n  httpclient: \n    enabled: false\n  sentinel: \n    enabled: true\n\nlogging: \n  test: ON\n  file.name: log/log.log\n  config: http://${NACOS_CONFIG_SERVER:localhost:8848}/nacos/v1/cs/configs?group=DEFAULT_GROUP&dataId=boot-log.xml\n  level: \n    root: ERROR\n    com.maozi: INFO\n    com.xxl.job.core.handler.impl.MethodJobHandler: INFO\n    org.springframework.cloud.stream.binding.StreamListenerMessageHandler: INFO', 'b45dbb7c12265b0bfc5f6140de8ba01b', '2024-01-02 08:03:45', '2024-01-02 16:03:46', 'nacos', '172.30.0.1', 'U', '');
