INSERT INTO `his_config_info` VALUES (102, 1630, 'maozi-cloud-gateway.yml', 'DEFAULT_GROUP', '', 'project:\n  title: 网关服务\n  details: 处理 流量分发、黑白名单、流控 等功能\n\napplication-port: ${application-dev-port:10000}\n\napplication-project-name: gateway\n\nspring: \n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      datasource:\n        gw-flow:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-flow\n            groupId: SENTINEL_GROUP\n            rule-type: gw-flow\n        gw-api-group:\n          nacos:\n            server-addr: ${spring.cloud.nacos.config.server-addr}\n            dataId: ${spring.application.name}-gw-api-group\n            groupId: SENTINEL_GROUP\n            rule-type: gw-api-group\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n\n\n      default-filters:\n      - StripPrefix=1\n      - name: Retry\n        args:\n          retries: 1\n          methods: GET,POST\n          statuses: BAD_GATEWAY,GATEWAY_TIMEOUT,SERVICE_UNAVAILABLE\n          series: INFORMATIONAL\n          exceptions: java.net.ConnectException,org.springframework.cloud.gateway.support.NotFoundException\n\n\n      routes: \n        - id: MAOZI-CLOUD-SYSTEM\n          uri: lb://maozi-cloud-system\n          predicates:\n          - Path=/system/**\n\n        - id: MAOZI-CLOUD-OAUTH\n          uri: lb://maozi-cloud-oauth\n          predicates:\n          - Path=/oauth/**\n          # filters:\n          #- StripPrefix=1\n          # - WSProtocolFilter\n\n      # default-filters:\n      #   - name: Hystrix\n      #     args:\n      #       name: default\n      #       #转发地址\n      #       fallbackUri: \'forward:/fallback\'\n      #   - name: Retry\n      #     args:\n      #       #重试次数，默认值是 3 次\n      #       retries: 3\n      #       #HTTP 的状态返回码\n      #       statuses: BAD_GATEWAY,BAD_REQUEST\n      #       #指定哪些方法的请求需要进行重试逻辑，默认值是 GET 方法\n      #       methods: GET,POST\n\n\n\n\nknife4j:\n  gateway:\n    enable: true\n    routes:\n      - name: 系统服务\n        url: /user/v2/api-docs?group=default\n        service-name: maozi-cloud-user\n      - name: 授权服务\n        url: /oauth/v2/api-docs?group=default\n        service-name: maozi-cloud-oauth', '42e0cd87ee3bcafd4233ada08fb5531c', '2024-01-07 00:20:26', '2024-01-07 08:20:27', 'nacos', '172.30.0.1', 'U', '');
