INSERT INTO `his_config_info` VALUES (1564, 1702, 'boot-db.yml', 'DEFAULT_GROUP', '', 'actable: \n  database: \n    type: mysql\n  model: \n    pack: com.maozi.${application-project-abbreviation}.*.domain\n\n\nmybatis-plus:\n  mapper-locations: classpath:com/maozi/${application-project-abbreviation}/*/mapper/*.xml,classpath*:com/gitee/sunchenbin/mybatis/actable/mapping/*/*.xml\n  # typeEnumsPackage: com.maozi.${application-project-abbreviation}.*.enums\n  configuration: \n    map-underscore-to-camel-case: true\n    log-impl: com.maozi.mybatisplus.config.MybatisPlusLog\n    default-enum-type-handler: com.baomidou.mybatisplus.core.handlers.MybatisEnumTypeHandler\n    # log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  global-config: \n    refresh: false\n    banner: false\n    db-config:\n      db-type: mysql\n      id-type: AUTO\n      field-strategy: NOT_NULL\n      column-like: false\n      capital-mode: true\n      logic-delete-value: 1\n      logic-not-delete-value: 0\n\nmybatis-plus-join:\n  banner: false\n\nmybatis:\n  configuration:\n    cache-enabled: false\n\nspring: \n  flyway: \n    table: system_table_flyway\n    clean-disabled: true\n    out-of-order: true\n    baseline-on-migrate: true\n    baseline-version: 0\n    locations: classpath:db/', '3fd69c28d87b7a25e54bed2ebff68301', '2024-01-07 08:50:25', '2024-01-07 16:50:25', 'nacos', '172.30.0.1', 'U', '');
